import { STORE_DATA } from "../ActionTypes/actiontype";
const StoreData = (payload) => ({
  type: STORE_DATA,
  payload: payload,
});
export { StoreData };



export const getData = (dispatch) => {
  axios
    .get(url)
    .then((res) => {
    //   console.log(res.data);
      dispatch(storeData(res.data));
    })
    .catch((err) => console.log(err));
};
